  \"2015-05-14T05:20:12.353041\",\n\t\"name\": \"boundaries-special-service-areas\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Special Service Areas (SSA) boundaries
  in Chicago. The Special Service Area program is a mechanism used to fund expanded
  services and programs through a localized property tax levy within contiguous industrial,
  commercial and residential areas. The enhanced services and programs are in addition
  to services and programs currently provided through the city. SSA-funded projects
  could include, but are not limited to, security services, area marketing and advertising
  assistance, promotional activities such as parades and festivals, or any variety
  of small scale capital improvements that could be supported through a modest property
  tax levy. The data can be viewed on the Chicago Data Portal with a web browser.
  However, to view or use the files outside of a web browser, you will need to use
  compression software and special GIS software, such as ESRI ArcGIS (shapefile) or
  Google Earth (KML or KMZ).\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
